import sys
from PyQt5.QtWidgets import QApplication, QLabel, QWidget
from PyQt5.QtCore import Qt, QPropertyAnimation, QPointF, pyqtProperty
from PyQt5.QtGui import QPixmap, QTransform, QImage, QColor, QPainter
import base64

class NadellaWalker(QWidget):
    def __init__(self):
        super().__init__()
        self.speed = 30  # Seconds for one full cycle (total back and forth)
        self.icon_size = 150
        self._flip_value = 0.0
        self.screen_width = QApplication.desktop().screenGeometry().width()
        self.screen_height = QApplication.desktop().screenGeometry().height()

        # Base64 encoded PNG image data (replace placeholder below)
        self.image_data_base64 = """

        """ 

        self.initUI()
        self.startAnimation()

    def initUI(self):
        self.setWindowFlags(
            Qt.WindowStaysOnTopHint |
            Qt.FramelessWindowHint |
            Qt.X11BypassWindowManagerHint |
            Qt.WindowTransparentForInput |
            Qt.Tool
        )
        self.setAttribute(Qt.WA_TranslucentBackground)
        self.setGeometry(0, 0, self.screen_width, self.screen_height)

        self.label = QLabel(self)

        # Load QPixmap from embedded base64 data
        image_bytes = base64.b64decode(self.image_data_base64)
        image = QImage.fromData(image_bytes)
        self.original_pixmap = QPixmap.fromImage(image).scaled(
            self.icon_size, self.icon_size,
            Qt.KeepAspectRatio, Qt.SmoothTransformation
        )
        self.pixmap = self.original_pixmap
        self.label.setPixmap(self.pixmap)
        self.label.resize(self.icon_size, self.icon_size)
        self.label.move(0, self.screen_height - self.icon_size)

    def startAnimation(self):
        self.anim = QPropertyAnimation(self.label, b"pos")
        self.anim.setDuration(self.speed * 1000)
        self.anim.setStartValue(QPointF(0, self.screen_height - self.icon_size))
        self.anim.setKeyValueAt(0.49, QPointF(self.screen_width - self.icon_size, self.screen_height - self.icon_size))
        self.anim.setKeyValueAt(0.5, QPointF(self.screen_width - self.icon_size, self.screen_height - self.icon_size))
        self.anim.setKeyValueAt(0.99, QPointF(0, self.screen_height - self.icon_size))
        self.anim.setEndValue(QPointF(0, self.screen_height - self.icon_size))
        self.anim.setLoopCount(-1)

        self.flip_anim = QPropertyAnimation(self, b"flip_value")
        self.flip_anim.setDuration(self.speed * 1000)
        self.flip_anim.setStartValue(0.0)
        self.flip_anim.setKeyValueAt(0.49, 0.0)
        self.flip_anim.setKeyValueAt(0.5, 1.0)
        self.flip_anim.setKeyValueAt(0.99, 1.0)
        self.flip_anim.setEndValue(0.0)
        self.flip_anim.setLoopCount(-1)

        self.anim.start()
        self.flip_anim.start()

    @pyqtProperty(float)
    def flip_value(self):
        return self._flip_value

    @flip_value.setter
    def flip_value(self, value):
        self._flip_value = value
        self.updateFlip(value)

    def updateFlip(self, value):
        result = QPixmap(self.icon_size, self.icon_size)
        result.fill(Qt.transparent)
        painter = QPainter(result)
        painter.setRenderHint(QPainter.SmoothPixmapTransform)
        center = QPointF(self.icon_size / 2, self.icon_size / 2)
        painter.translate(center)
        painter.scale(1 - 2 * value, 1)
        painter.translate(-center)
        painter.drawPixmap(0, 0, self.original_pixmap)
        painter.end()
        self.label.setPixmap(result)


if __name__ == "__main__":
    app = QApplication(sys.argv)
    window = NadellaWalker()
    window.show()
    sys.exit(app.exec_())